from typing import List
class Solution:
    def largestSubmatrix(self, matrix: List[List[int]]) -> int:
        m = len(matrix)
        n = len(matrix[0])

        ans = [ [0 for j in range(n)] for i in range(m) ]
        accmap = [ [0 for j in range(n)] for i in range(m) ]

        for x in range(n):
            acc = 0
            for y in range(m):
                if matrix[y][x]==0:
                    acc=0
                acc+=matrix[y][x]
                accmap[y][x]=acc
        #for r in accmap:
        #    print(r)
        area = 0
        for y in range(m):
            #tmp = [(accmap[y][i],i) for i in range(len(accmap[0]))]
            #tmp = sorted(tmp, reverse=True)
            #print("row",tmp)
            accmap[y].sort(reverse=True)
            # for x,pp in enumerate(tmp):
            #    for j in range(m):
            #        ans[j][x] = accmap[j][pp[1]]
            # accmap=[ [ans[i][j] for j in range(n)] for i in range(m) ]
            for x in range(n-1,-1,-1):
                area = max(accmap[y][x]*(x+1),area)
            #print("j", j,area)
            # for r in ans:
            #     print(r)



        return area
